import { Routes, Route } from 'react-router-dom';
import LogIn from '../account/LogIn';


const Account = (props) => {
  return (
    <container>
      <h3>account</h3>
      <Routes>
        <Route path='/account/login' element={<LogIn />} />
      </Routes>
    </container>

  );
}
export default Account;
